import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
// Import CartProvider using named import { }
import { CartProvider } from './context/CartContext'; 
// If you use an index.css file, uncomment the line below
// import './index.css'; 

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {/* FIX: App is now correctly wrapped by CartProvider */}
    <CartProvider>
      <App /> 
    </CartProvider>
  </React.StrictMode>
);
